import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';
import { useParams } from 'react-router-dom';

function Product() {
  const params = useParams
  return (
    <div>
      <NavSearch />
      <Row>
        <Col className='product'>
          <img src={''} alt="" />
